function share(plat,url,title){
  var plat = plat;
  var title= title;
  var url = url;
  if(url==""){
     url = document.location.href;
  }
  if(plat == "sina"){
	   window.open('http://service.weibo.com/share/share.php?url='+url+'&title='+title);
  }
  if(plat == "weixin"){
	  $("body").append('<div class="weixin-prop"><div class="weixin-close"></div><div class="weixin-img"></div><p>æ‰«ä¸€æ‰«åˆ†äº«</p></div>')
	  $('.weixin-img').qrcode(url);
  }
  if(plat == "qq"){
	  window.open('http://connect.qq.com/widget/shareqq/index.html?url=' + encodeURIComponent(url) + '&title='+title);
  }

}
$(document).on("click",".weixin-close",function(){
  $(".weixin-prop").remove();
});


